edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/post_click_event_type.proto";
import "youtube/api/innertube/post_click_error.proto";
import "youtube/api/innertube/post_click_response_received_data.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message PostClickData {
	PostClickEventType event_type = 1;
	PostClickError error = 2;
	PostClickResponseReceivedData response_received_data = 3;
}
